from dagster import op, job, get_dagster_logger, RetryPolicy, Field, String, resource, execute_in_process

# Resource definitions
@resource(config_schema={"airflow_url": Field(String)})
def airflow_resource(context):
    return {"airflow_url": context.resource_config["airflow_url"]}

# Op definitions
@op(required_resource_keys={"airflow_resource"})
def check_pcd_sftp_folder(context):
    """Verify SFTP folder availability and contents before starting ETL process."""
    job_template_file = "{{var.value.pcd_emtysftp_job}}"
    # Simulate Kubernetes job execution
    context.log.info(f"Executing Kubernetes job: {job_template_file}")
    return {"status": "success"}

@op(required_resource_keys={"airflow_resource"})
def check_pcd_shared_folder(context, sftp_folder_status):
    """Validate shared folder accessibility after SFTP check."""
    job_template_file = "{{var.value.pcd_emtydir_job}}"
    # Simulate Kubernetes job execution
    context.log.info(f"Executing Kubernetes job: {job_template_file}")
    return {"status": "success"}

@op
def start_pcd_extract_1(context, shared_folder_status):
    """Synchronization point after folder checks, initiates parallel API extraction."""
    context.log.info("Starting parallel HTTP API extraction tasks.")
    return {"status": "success"}

@op
def extract_api_data(context, start_extract_1_status, endpoint, method, payload):
    """Extract PCD data from various healthcare system APIs in parallel."""
    # Simulate HTTP POST request
    context.log.info(f"POST to {endpoint} with payload: {payload}")
    return {"status": "success", "response_code": 200}

@op
def start_pcd_extract_2(context, status_tracker_status):
    """Synchronization point after Status_Tracker API call completion."""
    context.log.info("Starting file upload processing.")
    return {"status": "success"}

@op(required_resource_keys={"airflow_resource"})
def pcd_file_upload(context, start_extract_2_status, api_data):
    """Execute main ETL job to process and upload extracted PCD data."""
    job_template_file = "{{var.value.pcd_job}}"
    # Simulate Kubernetes job execution
    context.log.info(f"Executing Kubernetes job: {job_template_file}")
    return {"status": "success"}

@op
def etl_notification(context, upstream_tasks):
    """Send comprehensive email notifications with success/failure status and failed task details."""
    success_email_list = "{{var.value.PCD_ETL_email_list_success}}"
    alert_email_list = "{{var.value.ETL_email_list_alerts}}"
    all_success = all(task["status"] == "success" for task in upstream_tasks)
    
    if all_success:
        context.log.info(f"Sending success email to: {success_email_list}")
    else:
        failed_tasks = [task for task in upstream_tasks if task["status"] != "success"]
        context.log.info(f"Sending failure email to: {alert_email_list} with details: {failed_tasks}")

